import React from 'react';
import { Checkbox } from 'semantic-ui-react'


const SelectMetric = ({keys}) => {

const ckb = keys.map( (k, i) => { 
    if(k !== 'date' | k!=='poi_id' | k!=='hour') return<Checkbox toggle label={k} style={{marginBottom:15, display: 'block'}} key={i}/> 
});
    return(
        <div>
            <p>Metrics</p>
            {ckb}
        </div>
    )
}

export default SelectMetric
